import ReactDOM from "react-dom/client";
const App = <div className="logs">
    <div className="item">
        <div className="date">
            <div className="month">四月</div>
            <div className="day">19</div>
        </div>
        <div className="content"></div>
    </div>
</div>;
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(App);
